                name: 'Плечи',
                duration: 20,
            },
            {   id: 3,
                name: 'Руки',
                duration: 30,
            },
            {   id: 4,
                name: 'Тело',
                duration: 40,
            },
            {   id: 5,
                name: 'Ноги',
                duration: 50,
            },
            {   id: 6,
                name: 'ШЛЯПА',
                duration: 60,
